import { Component, EventEmitter, OnInit, Output } from '@angular/core';
import { Recipe } from '../models/recipe.model';

@Component({
  selector: 'app-recipe-list',
  templateUrl: './recipe-list.component.html',
  styleUrls: ['./recipe-list.component.css']
})
export class RecipeListComponent implements OnInit {
  @Output() selectedRecipeFromList = new EventEmitter<Recipe>();
  recipes: Recipe[] = [
    new Recipe('Test Recipe', 'just test man!', 'data:image/jpeg;base64,'),
    new Recipe('Test Recipe2', 'just test man!', 'data:image/jpeg;base64,')
  ];
  constructor() { }

  ngOnInit(): void {
  }
  onSelectedRecipe(recipe: Recipe) {
    this.selectedRecipeFromList.emit(recipe);
  }
}
